const CardList = ({ characters}) => {
    const cardComponent = characters.map(character => {
       return  <Card id={character[0].id} name={characters[0].name}series={characters[0].series}image= {Banjo} />
    })


    return(
        <div>


            {/* Banjo & Kazooie */}
            <Card 
            id={characters[0].id} 
            name={characters[0].name}
            series={characters[0].series}
            image= {Banjo}
            />

            {/* Byleth */}
            <Card 
            id={characters[1].id} 
            name={characters[1].name}
            series={characters[1].series}
            image={Byleth}/>

        </div>
    )

}

export default CardList
